def proteinMass(pep):
	weight = 0
	for x in pep:
		weight += mass[x]
	return weight

def linospectrum(peptide):
	spec = [0]
	for x in range(1,len(peptide)):
		for i in range(len(peptide)):
			if i+x <= len(peptide):
				spec.append(proteinMass(peptide[i:i+x]))
	spec.append(proteinMass(peptide))
	spec.sort()
	return spec

def score(peptide, spectrum):
	spec = linospectrum(peptide)
	score = 0
	i = 0
	for x in spectrum:
		for y in range(i,len(spec)):
			if x == spec[y]:
				score +=1
				i = y+1
				break
	return score

def cut(leaderboard, spectrum, n):
	if len(leaderboard) <= n:
		return leaderboard
	scores = []
	for x in leaderboard:
		scores.append(score(x, spectrum))
	scores.sort()
	scores.reverse()
	min = scores[n-1]
	new = []
	for x in leaderboard:
		if score(x, spectrum) >= min:
			new.append(x)
	return new

